import React from "react";
import './contato.css';
import fotoWpp from './wpz.png';
import fotoEmail from './eml.png';
import fotoInsta from './inst.png';


function Contato (){
    return(
        <div className="principaldiv">

        <div className="wpp"> 
            <div className="texto"> <h1 id="ctt">Whatssap <br/>  +55 19 1234-5678 <br/> 55+ 19 9876-5432</h1></div>
            <div className="foto"><img id="wpp" src={fotoWpp}/></div>
        </div>

            <div className="email" > <img id="email" src={fotoEmail} /> <h1>Email</h1><span>meuemail@hotmail.com<br/>meuemail2@hotmail.com </span> </div>

            <div className="insta" > <img id="insta" src={fotoInsta} /><h1>Instagram</h1> <span> @meuinstagram</span></div>
        </div>
    )
}

export default Contato
